import React from "react";
function List() {
  return (
    <ul className="list-group">
   
      <li className="bg-dark text-white list-group-item">
        <input type="checkbox" id="feacbook" ></input>
        <label for="feacbook">feacbook</label>
      </li>
      <li className=" bg-dark  text-white list-group-item">
      <input type="checkbox" id="yout" ></input>
        <label for="yout">yout</label>
      </li>
      <li className=" bg-dark text-white  list-group-item">3</li>
    
    </ul>
  );
}
export default List;
